import React from 'react';

function AuthorCard(props) {
    return (
        <React.Fragment>
            <div className="card-body">
                <div className="text-center">
                    {props.apellido}, {props.nombre}
                </div>
            </div>
        </React.Fragment>
    )
}
export default AuthorCard;
